script: |
  super -f text -I q5309.spq | sort > q5309.out

inputs:
  - name: q5309.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE - + col2 NOT IN ( + 54 * + col2, + col1 + + 41 * + col1, - 19 + + col0 - - col1, 4, col2 + + 81, col0 - 25 + 37 );
  - name: tab1

outputs:
  - name: q5309.out
    data: |
      51	14	96
      85	5	59
      91	47	68
